// one thousand ways to encode a character...
// loading in 'translate' nearly crashed atom

function ggFilter(letter) {
  return letter.split('').filter(letter => ggChars.includes(letter)).join('');
}

function ggL2G(a) {
  let header = ggHeaders[randInt(0, 999)];
  let encoded = header + ggTranslate[(ggChars.indexOf(a) + 1) * (ggHeaders.indexOf(header) + 1)];
  return encoded;
} // per letter

function ggEncode(string) {
  let warbinger = ggFilter(string);
  let barqay = warbinger.split('');
  let encoded = barqay.map(ggL2G);
  return encoded.join('');
} // per string

function ggDecode(string){
  let warbinger = ggFilter(string);
  let decode = [];
  for (var i = 0; i < warbinger.length; i+=4)
  {decode.push(warbinger.slice(i, i+4,))};
  let decode2 = [];
  // ye there's probably a better way but i haven't paid enough attention to Bro Code
  for (var i = 1; i < decode.length; i+=2)
  {decode2.push(ggChars[Math.floor(ggTranslate.indexOf(decode[i])/ggHeaders.indexOf(decode[i-1]))-1])};
  // pimples: nope, blackheads: nada, readability: NO! (in heavy's voice)
  return decode2.join('');
} // this still operates by a letter-by-letter basis btw


// end of funcy functions

function randInt (a, b) {
  return Math.floor(Math.random() * b) + a;
}

function getEmoti(alt) {
  return alt.map(codePoint => String.fromCodePoint(codePoint));
} // emoji work

function lemonColor() {
   const hexASCII = "abcdef0123456789";
   const length = hexASCII.length;
   let generated = "#";
   for(let i = 0; i < 6; i++) {
      const ranASCII = Math.floor(Math.random() * length);
      generated += hexASCII.charAt(ranASCII);
   }
   return generated;
} // made by bludisalemon on github

